import React, { Component } from 'react'
import { Menu, Icon, Button } from 'antd'
import { MyContext } from '../../context';

export default class Nav extends Component {
  state = {
    user: {}
  }

  componentDidMount() {
    if (!this.context.state.loggedUser) return this.props.history.push('/login');
  }

  logOut = () => {
    this.props.history.push('/login')
    this.context.logOut()
  }
  render() {
    if (!this.context.state.loggedUser) return <p>Loading data...</p>
    return (
      <Menu mode="horizontal">
        <Menu.Item key="UsHomeer">
          <Icon type="home" />
          Home
        </Menu.Item>
        <Menu.Item key="User">
          <Icon type="user" />
          User
        </Menu.Item>
        <Menu.Ietm>
          <Button htmlType="submit" onClick={this.logOut}>Log out</Button>
          <Button htmlType="submit" onClick={this.logOut}>Log out</Button>
        </Menu.Ietm>
      </Menu>
    )
  }
}

Nav.contextType = MyContext
